boolean contains(Collection<Data> dataSet){
    for (Data data : dataSet) {
        boolean contains = false;
        for (QueueItem item : getItemQueue()) {
            if (item.getData() != null && item.getData().equals(data)) {
                contains = true;
                break;
            }
        }
        if (!contains) {
            return false;
        }
    }
    return true;
}

