        sec = Subscriber.MIN_ACK_DEADLINE_SECONDS;
    } else if (sec > Subscriber.MAX_ACK_DEADLINE_SECONDS) {
        sec = Subscriber.MAX_ACK_DEADLINE_SECONDS;
    }
