SplitBrainJoinMessage sendSplitBrainJoinMessage(Address target,SplitBrainJoinMessage request){
    if (logger.isFineEnabled()) {
        logger.fine("Sending SplitBrainJoinMessage to " + target);
    }
    Connection conn = node.connectionManager.getOrConnect(target, true);
    long timeout = SPLIT_BRAIN_CONN_TIMEOUT_MILLIS;
    while (conn == null) {
        timeout -= SPLIT_BRAIN_SLEEP_TIME_MILLIS;
        if (timeout < 0) {
            logger.fine("Returning null timeout<0, " + timeout);
            return null;
        }
        try {
            Thread.sleep(SPLIT_BRAIN_SLEEP_TIME_MILLIS);
        } catch (InterruptedException e) {
            currentThread().interrupt();
            return null;
        }
        conn = node.connectionManager.getConnection(target);
    }
    NodeEngine nodeEngine = node.nodeEngine;
    Future future = nodeEngine.getOperationService().createInvocationBuilder(ClusterServiceImpl.SERVICE_NAME, new SplitBrainMergeValidationOp(request), target).setTryCount(1).invoke();
    try {
        return (SplitBrainJoinMessage) future.get(SPLIT_BRAIN_JOIN_CHECK_TIMEOUT_SECONDS, TimeUnit.SECONDS);
    } catch (TimeoutException e) {
        logger.fine("Timeout during join check!", e);
    } catch (Exception e) {
        logger.warning("Error during join check!", e);
    }
    return null;
}

QuerySnapshot withChanges(Query query,Timestamp readTime,DocumentSet documentSet,List<DocumentChange> documentChanges){
    return new QuerySnapshot(query, readTime) {
        volatile List<QueryDocumentSnapshot> documents;
        @Nonnull
        @Override
        public List<QueryDocumentSnapshot> getDocuments() {
            if (documents == null) {
                synchronized (documentSet) {
                    if (documents == null) {
                        documents = documentSet.toList();
                    }
                }
            }
            return Collections.unmodifiableList(documents);
        }
        @Nonnull
        @Override
        public List<DocumentChange> getDocumentChanges() {
            return Collections.unmodifiableList(documentChanges);
        }
        @Override
        public int size() {
            return documentSet.size();
        }
        @Override
        public boolean equals(Object o) {
            if (this == o) {
                return true;
            }
            if (o == null || getClass() != o.getClass()) {
                return false;
            }
            QuerySnapshot that = (QuerySnapshot) o;
            return Objects.equals(query, that.query) && Objects.equals(this.size(), that.size()) && Objects.equals(this.getDocumentChanges(), that.getDocumentChanges()) && Objects.equals(this.getDocuments(), that.getDocuments());
        }
        @Override
        public int hashCode() {
            return Objects.hash(query, this.getDocumentChanges(), this.getDocuments());
        }
    };
}

