        do {
            Method[] methods = type.getDeclaredMethods();
            for (Method method : methods) {
                if (hasAnnotation(method, annotationType, checkMetaAnnotations)) {
                    return true;
                }
            }
            type = type.getSuperclass();
        } while (type != null);
    } catch (Throwable e) {
    }
    return false;
}

