void runQueryWithTimestampParameters(){
    DateTime timestamp = new DateTime(2016, 12, 7, 8, 0, 0, DateTimeZone.UTC);
    String query = "SELECT TIMESTAMP_ADD(@ts_value, INTERVAL 1 HOUR);";
    QueryJobConfiguration queryConfig = QueryJobConfiguration.newBuilder(query).addNamedParameter("ts_value", // Timestamp takes microseconds since 1970-01-01T00:00:00 UTC
    QueryParameterValue.timestamp(timestamp.getMillis() * 1000)).build();
    DateTimeFormatter formatter = ISODateTimeFormat.dateTimeNoMillis().withZoneUTC();
    for (FieldValueList row : bigquery.query(queryConfig).iterateAll()) {
        System.out.printf("%s\n", formatter.print(new DateTime(row.get(0).getTimestampValue() / 1000, DateTimeZone.UTC)));
        System.out.printf("\n");
    }
}

