            if (documentChanges == null) {
                synchronized (documents) {
                    if (documentChanges == null) {
                        documentChanges = new ArrayList();
                        for (int i = 0; i < documents.size(); ++i) {
                            documentChanges.add(new DocumentChange(documents.get(i), Type.ADDED, -1, i));
