ApiFuture<QuerySnapshot> get(ApiFuture<QuerySnapshot> get,ByteString transactionId){
    final SettableApiFuture<QuerySnapshot> result = SettableApiFuture.create();
    stream(new QuerySnapshotObserver() {
        List<QueryDocumentSnapshot> documentSnapshots = new ArrayList();
        @Override
        public void onNext(QueryDocumentSnapshot documentSnapshot) {
            documentSnapshots.add(documentSnapshot);
        }
        @Override
        public void onError(Throwable throwable) {
            result.setException(throwable);
        }
        @Override
        public void onCompleted() {
            QuerySnapshot querySnapshot = QuerySnapshot.withDocuments(Query.this, this.getReadTime(), documentSnapshots);
            result.set(querySnapshot);
        }
    }, transactionId);
    return result;
}

