boolean isAboveMaxToleratedMissCount(RepairingHandler handler){
    int partition = 0;
    long missCount = 0;
    do {
        MetaDataContainer metaData = handler.getMetaDataContainer(partition);
        missCount += metaData.getMissedSequenceCount();
        if (missCount > maxToleratedMissCount) {
            if (logger.isFinestEnabled()) {
                logger.finest(format("Above tolerated miss count:[map=%s,missCount=%d,maxToleratedMissCount=%d]", handler.getName(), missCount, maxToleratedMissCount));
            }
            return true;
        }
    } while (++partition < partitionCount);
    return false;
}

